import React from 'react'

const Footer = () => {
  return (
    <div className='mt-10 h-96 w-full bg-[rgb(0,3,30,0.9)]'>
        <div>
            <div>
            <img src='images/LOGO.jpg' className='w-[120px] h-[80px]' />
            </div>
        </div>
    </div>
  )
}

export default Footer
